<script type="text/javascript">
var unsavedChanges = false;
function validate(s)
{
var num = s;
var sum = 0;
var numdigits = num.length;
var parity = numdigits % 2;
for(var i=0; i < numdigits; i++) {
var digit = parseInt(num.charAt(i))
if(i % 2 == parity) digit *= 2;
if(digit > 9) digit -= 9;
sum += digit;
}
return (sum % 10) == 0;
}
</script>
